structs are a custom data type that provides a way to group values, defining a single entity that represents a collection of related values. We can define methods that can operate on the struct using a combination of impls and traits. In order to destructure a struct into multiple variables, you can use the following syntax: let Point{x: a, y: b} = origin; #[derive(Copy, Drop)]
struct Point { x: felt, y: felt } fn main() -> felt { let mut origin = Point { x: 0, y: 0 }; let p = Point { x: 1, y: 2 }; let x = origin.x; let Point{x: a, y: b } = origin; a // returns 0
}
